import React from "react"
import ReactDOM from "react-dom"
function App(props){

    return(
        <div>
        <h1>props.contact.name</h1>
        <h2>props.contact.phone</h2>
        </div>
    )
}
ReactDOM.render(<App />, document.getElementById("root"));
export default App
